import React, { useState, useEffect } from 'react';

function App() {
  const [stockData, setStockData] = useState([]);

  useEffect(() => {
    fetch('/api/stock-data')
      .then(response => {
        response.json()
      })
      .then(data => {
        const parsedData = JSON.parse(data);
        setStockData(parsedData);
      });
  }, []);

  return (
    <div>
      {stockData.map((data, index) => (
        <div key={index}>
          <p>{data.date}</p>
          <p>{data.open}</p>
          <p>{data.high}</p>
          <p>{data.low}</p>
          <p>{data.close}</p>
          <p>{data.volume}</p>
          <hr/>
        </div>
      ))}
    </div>
  );
}

export default App;
